int readToArray(int* array, char input[])
{
    int input_size=0;
    do{
        input_size++;
    }while(input[input_size]!=0);
    

    for(int i=0;i<input_size;i++)
    {
            array[input_size-i-1]=input[i]-'0';
    }
    return input_size;
}
